import React from 'react';
import hero from '../assets/home/photoguy.png';
import { Link } from 'react-router-dom'

const Home = () => {
  return (
    <section className='section'>
      <div className='container mx-auto h-full relative'>
        <div className='flex flex-col lg:flex-row h-full items-center justify-center lg:pt-16 gap-x-24 text-center lg:text-left'>
          <div className='flex-1 pt-8 lg:pt-0 lg:w-auto z-10 flex flex-col justify-center lg:items-start'>
            <h2 className='h1'>Nature <br />& Landscape <br />Photographer Me</h2>
            <Link to='/portfolio' className='btn'>See my Works</Link> 
          </div>
          <div className='flex-1 max-h-96 lg:max-h-max order-2 lg:order-none overflow-hidden'>
            <img src={hero} alt='Man1' className='max-w-full' />
          </div>
        </div>
      </div>      
    </section>
  );
};

export default Home;
